import React from 'react';
import './FooterBottom.scss'

const FooterBottom = () => {
    return (
        <div className='footerBottom'>
            <h1 className="footerBottom__title">
                KUGOO
            </h1>
                <img className='footerBottom__socialIcon' src="/images/google.svg" alt=""/>
                <img className='footerBottom__socialIcon' src="/images/apple.svg" alt=""/>
                <img className='footerBottom__socialIcon' src="/images/wk.svg" alt=""/>
                <img className='footerBottom__socialIcon' src="/images/google.svg" alt=""/>
                <img className='footerBottom__socialIcon' src="/images/google.svg" alt=""/>
                <img className='footerBottom__socialIcon' src="/images/google.svg" alt=""/>
        </div>
    );
};

export default FooterBottom;
